question:
In the diagram, the three concentric circles have radii of $4,$ $6,$ and $7.$ Three regions are labeled $X,$ $Y,$ or $Z$ below. Of these three regions, what is the difference between the area of the region with the greatest area and the area of the region with the smallest area? Express your answer in exact form.

[asy]
import graph;
filldraw(circle((0,0),7), lightgray, black+linewidth(1));
filldraw(circle((0,0),6), gray, black+linewidth(1));
filldraw(circle((0,0),4), white, black+linewidth(1));
dot((0,0));
label("$X$",(2,0));
label("$Y$",(5,0));
label("$Z$",(6.5,0));
[/asy]

Side $CD$ of rectangle $ABCD$ measures 12 meters, as shown. Each of the three triangles with a side along segment $CD$ is an equilateral triangle. What is the total area of the shaded regions? Express your answer in simplest radical form. [asy]
import olympiad; size(150); defaultpen(linewidth(0.8));
fill((2,2*sqrt(3))--(4,0)--(6,2*sqrt(3))--cycle^^(6,2*sqrt(3))--(8,0)--(10,2*sqrt(3))--cycle,gray(0.7));
draw((0,0)--(12,0)--(12,2*sqrt(3))--(0,2*sqrt(3))--cycle);
draw((0,0)--(2,2*sqrt(3))--(4,0)--(6,2*sqrt(3))--(8,0)--(10,2*sqrt(3))--(12,0));
label("$A$",(0,2*sqrt(3)),NW); label("$B$",(12,2*sqrt(3)),NE); label("$C$",(12,0),SE); label("$D$",(0,0),SW);
draw("12 meters", (0,2*sqrt(3) + 1)--(12,2*sqrt(3) + 1),N);
[/asy]

expected_output:
The two right triangles on the ends of the rectangle can be pushed together to form an equilateral triangle that is identical to each of the other equilateral triangles in the diagram.  So, $AB$ is equal to the total length of 3 side lengths of an equilateral triangle.  Therefore, each side of each equilateral triangle has length $12/3 = 4$.  Therefore, our problem is to find the total area of two equilateral triangles with side length 4.

Drawing an altitude of an equilateral triangle splits it into two 30-60-90 right triangles: [asy]
unitsize(0.6inch);
pair A, B, C, F;
A = (0,1);
B = rotate(120)*A;
C = rotate(120)*B;
F = foot(A,B,C);
draw(A--B--C--A,linewidth(1));
draw(A--F);
[/asy]

An altitude of an equilateral triangle is therefore $\sqrt{3}$ times the length of half the side length of the triangle.  Therefore, an equilateral triangle with side length 4 has altitude length $\sqrt{3}(4/2) = 2\sqrt{3}$, and area $(2\sqrt{3})(4)/2 = 4\sqrt{3}$ square units.  The shaded regions consist of two of these equilateral triangles, so their total area is $2(4\sqrt{3}) = \boxed{8\sqrt{3}}$.

question:
$P$ is the midpoint of $\overline{BD}$. $AP = BP = 4$, $\overline{AP} \perp \overline{BD}$, $\overline{BD} \perp \overline{DC}$, $\overline{AB} \perp \overline{BC}$. In simple radical form, what is the perimeter of pentagon $ABCDP$? [asy]
size(150); defaultpen(linewidth(0.8)); import geometry;
pair A = origin, B = (4,4), C = (12,-4), D = (4,-4), P = (4,0);
draw(A--P--B--cycle);
draw(B--D--C--cycle);
draw(rightanglemark(A,B,C,15));
draw(rightanglemark(A,P,B,15));
draw(rightanglemark(B,D,C,15));
label("$A$",A,SW); label("$B$",B,N); label("$C$",C,SE); label("$D$",D,SW); label("$P$",P,E); label("$4$",A--P,S); label("$4$",B--P,E);

[/asy]

In quadrilateral $ABCD$, angle $BAD$ and angle $CDA$ are trisected as shown. What is the degree measure of angle $AFD$?

[asy]
size(150);
pair A , B, C, D; A = (0,0); B = (2, 4); C = (7,4); D = (7, -2);
draw( (0,0)--(2,4) -- (7,4) -- (7, -2)-- cycle);
label("$A$", A, SW);
label("$B$", B, NW);
label("$C$", C, NE);
label("$D$", D, SE);
pair E, F;
E = (4.5-.2,1-.2); F = (5, 3);
draw(A--E--D); draw(A--F--D);
label("$E$", E, N); label("$F$", F, NW);
dot(A);dot(B);dot(C);dot(D);dot(E);dot(F);
label("$x$", (1, 1.5), S); label("$x$", (2, 1), S+W); label("$x$", (2, -1), N+N+N+W);
label("$y$", (5.5+.3, .5-.3), S); label("$y$", (6.5+.3, 0)); label("$y$", (5+.5, -1.5+.3));
label("$110^{\circ}$",(2.5,3.5)); label("$100^{\circ}$",(6.5-.2,3.5));
[/asy]

Each triangle is a 30-60-90 triangle, and the hypotenuse of one triangle is the longer leg of an adjacent triangle. The hypotenuse of the larger triangle is 16 centimeters. What is the number of centimeters in the length of the longer leg of the smaller triangle?

[asy]size(150); pair O; for(int i = 2; i < 5; ++i){
draw(O--((2/sqrt(3))^i)*dir(30*i));
}
for(int g = 2; g < 4; ++g){
draw( ((2/sqrt(3))^g)*dir(30*g)-- ((2/sqrt(3))^(g+1))*dir(30*g+30));
}
label("16 cm", O--(16/9)*dir(120), W);
//label("$30^{\circ}$",.4*dir(0),dir(90));
//label("$30^{\circ}$",.4*dir(25),dir(115));
label("$30^{\circ}$",.4*dir(50),dir(140));
label("$30^{\circ}$",.4*dir(85),dir(175));
real t = (2/(sqrt(3)));
//draw(rightanglemark((1,.1),(1,0),(.9,0),s=3));
draw(rightanglemark(rotate(30)*(0,t**4),rotate(0)*(0,t**3),O,s=3));
draw(rightanglemark(rotate(0)*(0,t**3),rotate(-30)*(0,t**2),O,s=3));
//draw(rightanglemark(rotate(-30)*(0,t**2),rotate(-60)*(0,t**1),O,s=3));
[/asy]

expected_output:
First, we label the diagram as shown below:

[asy] size(170);
pair O; for(int i = 2; i < 5; ++i){
draw(O--((2/sqrt(3))^i)*dir(30*i));
}
for(int g = 2; g < 4; ++g){
draw( ((2/sqrt(3))^g)*dir(30*g)-- ((2/sqrt(3))^(g+1))*dir(30*g+30));
}
label("16 cm", O--(16/9)*dir(120), W);
//label("$30^{\circ}$",.4*dir(0),dir(90));
//label("$30^{\circ}$",.4*dir(25),dir(115));
label("$30^{\circ}$",.4*dir(50),dir(140));
label("$30^{\circ}$",.4*dir(85),dir(175));
real t = (2/(sqrt(3)));
label("$B$",(0,t**3),N);
label("$A$",rotate(30)*(0,t**4),NW);
label("$C$",rotate(-30)*(0,t*t),NE);
//label("$D$",rotate(-60)*(0,t),NE);
//label("$E$",(1,0),E);
label("$O$",O,S);
//draw(rightanglemark((1,.1),(1,0),(.9,0),s=3));
draw(rightanglemark(rotate(30)*(0,t**4),rotate(0)*(0,t**3),O,s=3));
draw(rightanglemark(rotate(0)*(0,t**3),rotate(-30)*(0,t**2),O,s=3));
//draw(rightanglemark(rotate(-30)*(0,t**2),rotate(-60)*(0,t**1),O,s=3));
[/asy]

Both right triangles are 30-60-90 triangles. Therefore, the length of the shorter leg in each triangle is half the hypotenuse, and the length of the longer leg is $\sqrt{3}$ times the length of the shorter leg.  We apply these facts to each triangle, starting with $\triangle AOB$ and working clockwise.

From $\triangle AOB$, we find $AB = AO/2 = 8$ and $BO = AB\sqrt{3}=8\sqrt{3}$.

From $\triangle BOC$, we find $BC = BO/2 =4\sqrt{3}$ and $CO = BC\sqrt{3} =4\sqrt{3}\cdot\sqrt{3} = \boxed{12}$.
